import * as React from "react";
import { StyleProp, ViewStyle, Image, StyleSheet } from "react-native";

const HomeActive = ({ style }) => {
  return (
    <Image
      style={[styles.iconsaxlinearmessage, style]}
      resizeMode="cover"
      source={require("../assets/HomeActive.png")}
    />
  );
};

const styles = StyleSheet.create({
  iconsaxlinearmessage: {
    width: 24,
    height: 24,
    overflow: "hidden",
  },
});

export default HomeActive;
